import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
// root.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>
// );

function clock() {
  const element = (
    <div>
      <h2>This is Clock!</h2>
      <h3>Time is {new Date().toLocaleTimeString()}</h3>
    </div>
  );
  root.render(<App />,element);
}
setInterval(clock, 0);
